import React from 'govuk-react';
import TopNav from '@govuk-react/top-nav';
import  Crown from '@govuk-react/icon-crown';


function MyHeader() {
    return (

             
        <TopNav company={
            <TopNav.Anchor Linkto="gov.uk/" target="new">
                <TopNav.IconTitle icon={<Crown height="32" width="36" />}>
                    GOV.UK
                </TopNav.IconTitle>
            </TopNav.Anchor>}
            serviceTitle={
                <TopNav.NavLink href="/MedRecordsStartPage" target="new">
                        Medical Records
                    </TopNav.NavLink>}
        />        


    );

}


export default MyHeader;
